      <PREAMB>
        <AGENCY TYPE="S">DEPARTMENT OF THE TREASURY</AGENCY>
        <SUBAGY>Internal Revenue Service</SUBAGY>
        <SUBJECT>Quarterly Publication of Individuals, Who Have Chosen To Expatriate, as Required by Section 6039G</SUBJECT>
        <AGY>
          <HD SOURCE="HED">AGENCY:</HD>
          <P>Internal Revenue Service (IRS), Treasury.</P>
        </AGY>
        <ACT>
          <HD SOURCE="HED">ACTION:</HD>
          <P>Notice.</P>
        </ACT>
        <SUM>
          <HD SOURCE="HED">SUMMARY:</HD>

          <P>This notice is provided in accordance with IRC section 6039G of the Health Insurance Portability and Accountability Act (HIPPA) of 1996, as amended. This listing contains the name of each individual losing United States citizenship (within the meaning of section 877(a) or 877A) with respect to whom the Secretary received information during the quarter ending June 30, 2014. For purposes of this listing, long-term residents, as defined in section 877(e)(2), are treated as if they were citizens of the United States who lost citizenship.<PRTPAGE P="46307"/>
          </P>
