    </NOTICE>','Proposed Collection; Comment Request for Information Collection Tools',' &#8230;  Under Sections 877A, 2801, and <span class="match">6039G</span>; Form 1120-FSC, U.S &#8230;  Under Sections 877A, 2801, and <span class="match">6039G</span>.
OMB Number: 1545-2123.
