INSERT INTO reports VALUES(23,'2009-07-27','Notice',NULL,'https://www.federalregister.gov/articles/2009/07/27/E9-17741/proposed-collection-comment-request-for-notice-2008-xx','http://www.gpo.gov/fdsys/pkg/FR-2009-07-27/pdf/E9-17741.pdf','https://www.federalregister.gov/articles/xml/E91/774/1.xml','<NOTICE>
      <PREAMB>
        <AGENCY TYPE="N">DEPARTMENT OF THE TREASURY</AGENCY>
        <SUBAGY>Internal Revenue Service</SUBAGY>
        <DEPDOC>[Notice 2008-XX]</DEPDOC>
        <SUBJECT>Proposed Collection; Comment Request for Notice 2008-XX</SUBJECT>
        <AGY>
          <HD SOURCE="HED">AGENCY:</HD>
          <P>Internal Revenue Service (IRS), Treasury.</P>
        </AGY>
        <ACT>
          <HD SOURCE="HED">ACTION:</HD>
          <P>Notice and request for comments.</P>
        </ACT>
        <SUM>
          <HD SOURCE="HED">SUMMARY:</HD>
          <P>The Department of the Treasury, as part of its continuing effort to reduce paperwork and respondent burden, invites the general public and other Federal agencies to take this opportunity to comment on proposed and/or continuing information collections, as required by the Paperwork Reduction Act of 1995, Public Law 104-13 (44 U.S.C. 3506(c)(2)(A)). Currently, the IRS is soliciting comments concerning Notice 2008-XX, Guidance for Expatriates and Recipients of Foreign Source Gifts and Bequests Under Sections 877A, 2801, and 6039G.</P>
        </SUM>
        <DATES>
          <HD SOURCE="HED">DATES:</HD>
          <P>Written comments should be received on or before September 25, 2009 to be assured of consideration.</P>
        </DATES>
        <ADD>
          <HD SOURCE="HED">ADDRESSES:</HD>
          <P>Direct all written comments to R. Joseph Durbala, Internal Revenue Service, Room 6129, 1111 Constitution Avenue, NW., Washington, DC 20224.</P>
        </ADD>
        <FURINF>
          <HD SOURCE="HED">FOR FURTHER INFORMATION CONTACT:</HD>

          <P>Requests for additional information or copies of the regulations should be directed to Dawn Bidne at Internal Revenue Service, Room 6129, 1111 Constitution Avenue, NW., Washington, DC 20224, or at (202) 622-3933, or through the Internet at<E T="03">Dawn.E.Bidne@irs.gov.</E>
          </P>
        </FURINF>
      </PREAMB>
      <SUPLINF>
        <HD SOURCE="HED">SUPPLEMENTARY INFORMATION:</HD>
        <P/>
        <P SOURCE="NPAR">
          <E T="03">Title:</E>Guidance for Expatriates and Recipients of Foreign Source Gifts and Bequests Under Sections 877A, 2801, and 6039G.</P>
        <P>
          <E T="03">OMB Number:</E>1545-2123.</P>
        <P>
          <E T="03">Regulation Project Number:</E>Notice 2008-XX.</P>
        <P>
          <E T="03">Abstract:</E>Section 301 of the Heroes Earnings Assistance and Relief Tax Act of 2008 (the &#x201C;Act&#x201D;) enacted new sections 877A and 2801 of the Internal Revenue Code (&#x201C;Code&#x201D;), amended sections 6039G and 7701(a), made conforming amendments to sections 877(e) and 7701(b), and repealed section 7701(n). This notice provides guidance regarding certain Federal tax consequences under these sections for individuals who renounce U.S. citizenship or cease to be taxed as lawful permanent residents of the United States.</P>
        <P>
          <E T="03">Current Actions:</E>There is no change to this existing regulation.</P>
        <P>
          <E T="03">Type of Review:</E>Extension of a currently approved collection.</P>
        <P>
          <E T="03">Affected Public:</E>Individuals or households.</P>
        <P>
          <E T="03">Estimated Number of Respondents:</E>100.</P>
        <P>
          <E T="03">Estimated Time per Respondent:</E>4 Hours 17 minutes.</P>
        <P>
          <E T="03">Estimated Total Annual Burden Hour</E>s: 420.</P>
        <P>The following paragraph applies to all of the collections of information covered by this notice:</P>
        <P>An agency may not conduct or sponsor, and a person is not required to respond to, a collection of information unless the collection of information displays a valid OMB control number. Books or records relating to a collection of information must be retained as long as their contents may become material in the administration of any internal revenue law. Generally, tax returns and tax return information are confidential, as required by 26 U.S.C. 6103.</P>
        <P>
          <E T="03">Request for Comments:</E>Comments submitted in response to this notice will be summarized and/or included in the request for OMB approval. All comments will become a matter of public record. Comments are invited on: (a) Whether the collection of information is necessary for the proper performance of the functions of the agency, including whether the information shall have practical utility; (b) the accuracy of the agency''s estimate of the burden of the collection of information; (c) ways to enhance the quality, utility, and clarity of the information to be collected; (d) ways to minimize the burden of the collection of information on respondents, including through the use of automated collection techniques or other forms of information technology; and (e) estimates of capital or start-up costs and costs of operation, maintenance, and purchase of services to provide information.</P>
        <SIG>
          <DATED>Approved: July 17, 2009.</DATED>
          <NAME>R. Joseph Durbala,</NAME>
          <TITLE>IRS Reports Clearance Officer.</TITLE>
        </SIG>
      </SUPLINF>
      <FRDOC>[FR Doc. E9-17741 Filed 7-24-09; 8:45 am]</FRDOC>
      <BILCOD>BILLING CODE 4830-01-P</BILCOD>
    </NOTICE>','Proposed Collection; Comment Request for Notice 2008-XX',' &#8230;  Under Sections 877A, 2801, and <span class="match">6039G</span>.
DATES:
Written comments should be &#8230;  Under Sections 877A, 2801, and <span class="match">6039G</span>.
