Regulation &#8230;  Revenue Code (Code), amended sections <span class="match">6039G</span> and 7701(a), made conforming &#8230; ','[{"raw_name":"DEPARTMENT OF THE TREASURY","parent_id":null,"json_url":"https://www.federalregister.gov/api/v1/agencies/497.json","url":"https://www.federalregister.gov/agencies/treasury-department","name":"Treasury Department","id":497},{"raw_name":"Internal Revenue Service","parent_id":497,"json_url":"https://www.federalregister.gov/api/v1/agencies/254.json","url":"https://www.federalregister.gov/agencies/internal-revenue-service","name":"Internal Revenue Service","id":254}]','E9-17741','The Department of the Treasury, as part of its continuing effort to reduce paperwork and respondent burden, invites the general public and other Federal agencies to take this opportunity to comment on proposed and/or continuing information collections, as required by the Paperwork Reduction Act of 1995, Public Law 104-13 (44 U.S.C. 3506(c)(2)(A)). Currently, the IRS is soliciting comments concerning Notice 2008-XX, Guidance for Expatriates and Recipients of Foreign Source Gifts and Bequests Under Sections 877A, 2801, and 6039G.',NULL);
